import React, { Component } from 'react';
import { displayUser } from '../../actions';
import { connect } from 'react-redux';
import Grid from './Sections/Grid';

class RegisteredUser extends Component {
  componentDidMount() {
    this.props.displayUser();
  }

  render() {
    const { users } = this.props.dashboard.users;
    return (
      <div>
        RegisteredUser :{' '}
        {users.map((user, data) => (
          <Grid
            firstName={user.firstName}
            lastName={user.lastName}
            email={user.email}
            role={user.role}
          />
        ))}
      </div>
    );
  }
}

const mapStateToProps = (state) => ({
  users: state.dashboard.users,
});

export default connect(mapStateToProps, { displayUser })(RegisteredUser);
